const startTimestamp = (new Date()).setHours(0,0,0,0);
const interval = 60 * 60 * 1000;

// Transformation priceData
const transformPriceData = (data) => {
    return data.map(item => ({
        value: item.price,
        start: item.start,
        exportPrice: 0.079, // Bei Bedarf anpassen
        importPrice: item.price
    }));
};

// Transformation productionForecast
const transformProductionForecast = (data) => {
    return data.map(item => ({
        start: new Date(new Date(item.period_end).getTime() - 3600000).toISOString(),
        value: item.pv_estimate // in kWh
    }));
};

// Transformation consumptionForecast
const transformConsumptionForecast = (data, startTimestamp, interval) => {
    return data.map((value, index) => ({
        start: (new Date(startTimestamp + index * interval)).toISOString(),
        value: value // in kWh
    }));
};

const priceData = msg.input.priceData;
const productionForecast = msg.input.pvforecast;
const consumptionForecast = msg.input.household;

const transformedData = {
    priceData: transformPriceData(priceData),
    productionForecast: transformProductionForecast(productionForecast),
    consumptionForecast: transformConsumptionForecast(consumptionForecast, startTimestamp, interval),
    soc: msg.input.soc
};

delete msg.input;

msg.payload = transformedData;

return msg;
